      | 47699 -> { ItemTypeData.id= 47699; name= "Decayed Stasis Webifier Mutaplasmid"; published= true; description= "This bioadaptive mutaplasmid tool is designed to interface with and alter energy stasis entanglement devices. As such this mutaplasmid could be used to mutate the performance characteristics of most stasis webifiers.    Triglavian bioadaptive technology makes extensive use of engineered colonies of extremophilic bacteria, that are used to grow, harvest and adapt various resources found in Abyssal Deadspace. Artificial colonizing plasmids integrated into specialist tools used for direct adaptation of technology can be found in Triglavian caches in various stages of development. These mutaplasmids can be used to alter the characteristics of a wide variety of equipment types, depending on the strain and the bioadaptive tool with which they are integrated.    The mutaplasmid colony integrated into this bioadaptive tool has begun to decay and mutation effects will be less pronounced as a result. While possible mutational benefits are low, the risks of using this mutaplasmid are also reduced."; marketGroupId= Some(2442); groupId= 1964; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
      | 47893 -> { ItemTypeData.id= 47893; name= "Fierce Dark Filament"; published= true; description= "This Abyssal Filament will pull a <b>Tech I or Tech II Cruiser</b> into a pocket of Abyssal Deadspace with a <b>fierce and volatile environment</b>, and clouded by a field of dark matter that will <b>reduce weapon ranges</b> but <b>enhance ship velocity</b>.    <b><color=yellow>Warning:</color></b> Abyssal Deadspace is a particularly harsh and unforgiving environment. Entanglement of the warp core with a space-time filament introduces severe deformations of the ship's warp field that cumulatively increase over time. After <b><color=yellow>20 minutes</color></b> catastrophic collapse of the warp field is predicted, with <b><color=yellow>destruction of the ship and capsule</color></b> certain.    A device of Triglavian design that functions as one end of an energetically inert filament of space-time connected to a specific pocket of Abyssal Deadspace. When activated by a ship equipped with a warp core that has the correct mass-energy parameters, the filament becomes a conduit that will draw the activating vessel along it and into the connected deadspace pocket.     The mass-energy exchange involved leaves a highly energetic trace at the ship's origin point and the space-time filament remains entangled with the warp core of the ship that uses it. Triglavian Transfer Conduits will permit such a ship to progress through the deadspace pocket but an Origin Conduit will return the ship to its starting location in normal space."; marketGroupId= Some(2458); groupId= 1979; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 0.100000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 2760; value= 47863.000000 }; { DogmaAttributeValueData.attributeId = 2761; value= 3.000000 } |];